179180;instagram;2019-01-13 21:08:29;FALSE;i am not fully healed, i am not fully wise, i am still on my way. what matters is that i am moving forward. despite all things i have been through in my life, i will continue to hold my head up high and move on. because i am a survivor not a victim. in order to love who you are, you cannot hate the experiences that shaped you. you are worth everything! you are strong and amazing! take your power back and stand strong, you never know who needs to hear your story and know they are not alone. let’s come together and let every woman out there know that there is a place for support and love by posting #metoo in the comments! let’s create a safe space right here for us all! 💜 #metoo #survivor #notalone #strong;;en;#metoo, #metoo, #survivor, #notalone, #strong;;;;;0;;jessicavockrodt;Jessica Vockrodt;;0;False;2;0;0;18;https://instagram.fyvr3-1.fna.fbcdn.net/vp/e626fde8f5f29d69de52aa44de6cf46b/5D19F5BD/t51.2885-15/e35/49307811_698211757246851_8422313368209947369_n.jpg?_nc_ht=instagram.fyvr3-1.fna.fbcdn.net;0;FALSE;FALSE;FALSE;english;i am not fully healed, i am not fully wise, i am still on my way. what matters is that i am moving forward. despite all things i have been through in my life, i will continue to hold my head up high and move on. because i am a survivor not a victim. in order to love who you are, you cannot hate the experiences that shaped you. you are worth everything! you are strong and amazing! take your power back and stand strong, you never know who needs to hear your story and know they are not alone. let’s come together and let every woman out there know that there is a place for support and love by posting #metoo in the comments! let’s create a safe space right here for us all! 💜 #metoo #survivor #notalone #strong;i am not fully healed, i am not fully wise, i am still on my way. what matters is that i am moving forward. despite all things i have been through in my life, i will continue to hold my head up high and